    this.state = { next: 0,
                   img:[]};

    this.state.img.push("https://www.google.com/imgres?imgurl=https%3A%2F%2Frp-online.de%2Fimgs%2F32%2F1%2F8%2F7%2F5%2F4%2F2%2F4%2F1%2Ftok_984a964461686d660f13cf8ff9c3a9ef%2Fw940_h528_x470_y264_aa0290ec02b5b02f.jpg&imgrefurl=https%3A%2F%2Frp-online.de%2Fsport%2Ffussball%2Finternational%2Fspanien%2Fcopa-del-rey-12-13-real-barcelona-1-1_bid-15957503&docid=mgAXWAnKTPvJaM&tbnid=3wo2wuntfGt9TM%3A&vet=10ahUKEwi4h6Xk-8_iAhUSKBoKHY4bCU0QMwhGKAMwAw..i&w=940&h=528&itg=1&client=firefox-b-d&bih=799&biw=1600&q=12%20images%20from%20Barcelona&ved=0ahUKEwi4h6Xk-8_iAhUSKBoKHY4bCU0QMwhGKAMwAw&iact=mrc&uact=8")
    this.state.img.push("https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTrN2RAtaap1Hk-pO0gORz0tPInvTlqFs0ISJhJoarvAo5aHDqinA")  
  };

  render() { 
    return (<img className="ScreenLayout" src={this.state.img[ this.state.next++ % 2 ]} alt="barcelona" />);
  }
}

export default Screen;
